import React from 'react';

const Input = props => {
  return (
    <div className='row'>
      <div className='col s3 m3 l3'>
        <button
          className='material-icons'
          name={props.id}
          id='-1'
          onClick={props.one}
        >
          exposure_neg_1
        </button>
      </div>
      <div className='col s5 m5 l5'>
        <input
          className='col s12 m10 l10'
          type='number'
          value={props.req}
          onChange={props.change}
          style={{ height: 20, textAlign: 'center', marginLeft: 15 }}
        />
      </div>
      <div className='col s3 m3 l3'>
        <button
          className='material-icons'
          name={props.id}
          id='1'
          onClick={props.one}
        >
          exposure_plus_1
        </button>
      </div>
    </div>
  );
};

export default Input;
